import React from "react";
import ScrollAnimation from "react-animate-on-scroll";
import { FiMail } from "react-icons/fi";
import { Link } from "react-router-dom";
const CallToAction = ({ textAlign, serviceStyle }) => {
  return (
    <div
      className="rn-callto-action clltoaction-style-default style-6 bg_image bg_image_fixed"
      style={{ backgroundImage: `url(/images/timeline/subs1.jpg)` }}
      data-black-overlay="8"
    >
      <div className="container ">
        <main>
          <div className="row row--15 service-wrapper center align-content-center align-self-center justify-center justify-content-center ">
            <div className="col-lg-4 col-md-6 col-sm-6 col-12 ">
              <div className={`service service__style--2 text-center `}>
                <div className="thumbnail image-left-content">
                  <img
                    src={`/images/ihelp/work.png`}
                    alt="card Images"
                    style={{ borderRadius: "20px" }}
                  />
                </div>
                <div className="inner ">
                  <div className="content-right">
                    <h4 className="title" style={{ color: "#fff" }}>
                      <Link
                        to="#service"
                        dangerouslySetInnerHTML={{
                          __html: "Маркетер танд зориулав",
                        }}
                      ></Link>
                    </h4>
                    <p
                      className="description b1 color-gray mb--0"
                      dangerouslySetInnerHTML={{
                        __html:
                          "Танд болон таны бизнест хэрэгтэй маркетингийн сонирхолтой боломж болон саналуудыг цаг алдалгүй хүлээн аваарай",
                      }}
                    ></p>
                    <form
                      className="blog-search"
                      action="#"
                      // onSubmit={handleAddFormSumbit}
                    >
                      <input
                        type="text"
                        name="name"
                        //   onChange={handleAddFormChange}
                        placeholder="И-мэйл хаягаа бичнэ үү  "
                      />
                      <button className="search-button" type="submit">
                        <FiMail />
                      </button>
                    </form>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </main>
      </div>
    </div>
  );
};
export default CallToAction;
